	const [name,setname]=useState("");
	const [email,setEmail]=useState("");
	const [pass,setPass]=useState("");

const signup=(e)=>{
	    e.preventDefault();
	try{
		 axios.post("http://localhost:2000/auth/signUp",{
			name:name,
			email:email,
			password:pass
		}).then((response)=>{
		})
		.catch((err)=>{
			console.log(err);
		})

	}catch(e){
		console.log(e);
	}
}
